	public static String Md5_32(String ConvertString)
    {
      
        MessageDigest md;
        StringBuffer sb = new StringBuffer();
        try {
        	  byte[] s=new String(ConvertString.getBytes(),"UTF-8").getBytes();
             md = MessageDigest.getInstance("MD5");
             md.update(s);
             byte[] data = md.digest();
             int index;
             for(byte b : data) {
                  index = b;
                  if(index < 0) index += 256;
                  if(index < 16) sb.append("0");
                  sb.append(Integer.toHexString(index));
             }
        } catch (Exception e) {
         e.printStackTrace();
        }
        return sb.toString();
}
